import React from 'react';
import './SkeletonLoader.css';

const SkeletonLoader = () => {
  return (
    <tr>
      <td colSpan="8">
        <div className="skeleton-loader">
          <div className="skeleton skeleton-number"></div>
          <div className="skeleton skeleton-coin-info"></div>
          <div className="skeleton skeleton-chart"></div>
          <div className="skeleton skeleton-price"></div>
          <div className="skeleton skeleton-change"></div>
          <div className="skeleton skeleton-volume"></div>
          <div className="skeleton skeleton-marketcap"></div>
          <div className="skeleton skeleton-buy"></div>
        </div>
      </td>
    </tr>
  );
};

export default SkeletonLoader;
